import React from 'react';
import styled from 'styled-components';
import MenuIcon from '@material-ui/icons/Menu';



function Header() {
    return (
        <div>
           <Container>
                <img src="/images/logo.svg" alt="" />

                <Menu>
            <a href="#">Model S</a>
            <a href="#">Model S</a>
            <a href="#">Model S</a>
            <a href="#">Model S</a>

           </Menu>
           <RightMenu>
           <a href="#">Shop</a>
            <a href="#">Tesla Account</a>

           <CustomMenu />
           </RightMenu>
           <BurgerNav>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
               <li><a href="#">Existing Inventory</a></li>
           </BurgerNav>


           </Container>

        </div>
    )
}

export default Header

const Container = styled.div`
  min-height:50px;
  position:fixed;
  display:flex;
  align-item:center;
  justify-content:space-between;
  padding: 0 20px;
  top:0;
  left:0;
  right:0;

`

const Menu = styled.div`
 display:flex;
 padding-top:10px;
 align-items:center;
 justify-content:center;
 flex:1;
 a{
     font-weight:600;
     color:black;
     text-transform:uppercase;
     padding:0 10px;
     flex-wrap:nowrap;
    }

    @media(max-width:786px) {
        display:none;
    }

`
const RightMenu = styled.div`
display:flex;
padding-top:10px;
align-items:center;
a{
    font-weight:600;
    color:black;
    text-transform:uppercase;
    margin-right:10px;
    flex-wrap:nowrap;
   }
`
const CustomMenu = styled(MenuIcon)`
 cursor:pointer;
 font-weight:600;

`
const BurgerNav  = styled.div`
  position:fixed;
  top:0;
  bottom:0;
`
